var bananas = [];
var basket;
var score = 0;
var lives = 3;
var frequency = 60;
var game = false;
var gameOver = false;
var monkeyImage;
var monkey;
var bananaImage;
var basketImage;
var jungleMusic;
var catchSound;
var nameInput;
var showButtons;
var database;
var ref;
var scoreboard = false;
var scoreArray = [];
var bananaSpeedIncrease = 0;
var backgroundImage;
var titleScreen = true;
var introImage;
var introButton;
var bananaStore = false;

function preload() {
	jungleMusic = loadSound ('https://hzamani2.github.io/gameMusic/jungle2.mp3');
	catchSound = loadSound ('https://hzamani2.github.io/gameMusic/catch.wav');
}


function setup() {

	//canvas
	canvas = createCanvas (800, 600);
	canvas.position (0, 0);

	//game objects
	basket = new Basket ();
	monkey = new Monkey (width/2);

	//name input
	input = createInput ("");
	input.hide();

	//submit button
	button = createButton('submit');
	button.mouseClicked(recordsScore);
	button.hide();

	//center button and input
	input.position (width/2 - input.width/2 - button.width/2, height/2 + 60);
	button.position(input.x + input.width + 10, height/2 + 60);


	//image loades
	imageMode (CENTER);
	monkeyImage = loadImage ("data:image/png;base64,");
	bananaImage = loadImage ("data:image/png;base64,");
	basketImage = loadImage ("data:image/png;base64,");
	backgroundImage = loadImage ("data:image/jpeg;base64,");
	introImage = loadImage ("data:image/jpeg;base64,");
	
	//background music
	jungleMusic.setVolume (.3);
	jungleMusic.play();

	//firebase configuration
	var config = {
	    apiKey: "AIzaSyB9HpbVp9ZHNeKxUBgIAx7lCi7Ky8dMzJQ",
	    authDomain: "highscore-28e4a.firebaseapp.com",
	    databaseURL: "https://highscore-28e4a.firebaseio.com",
	    projectId: "highscore-28e4a",
	    storageBucket: "highscore-28e4a.appspot.com",
	    messagingSenderId: "1025304412506"
	};

	//reference to scores node
	firebase.initializeApp(config);
	database = firebase.database();
	ref = database.ref('scores');
	ref.on("value", gotData);

	//intro button
	introButton = new Button (width/4 * 3, height/5 * 4.2, 120, 50, "Help Bongo!");

}




function draw() {
	if (bananaStore) {

	}
	if (titleScreen) {
		background (0);
		textAlign (CENTER);
		fill (255);
		textSize (45);
		text ("Monkey Business", width/2, 50);
		imageMode (CORNER);
		image (introImage, 0, height/5,);
		textSize (32);
		text ("Bongo the Monkey collected too many bananas and is dropping them all over the jungle. The shelves will be empty at Bongo's Banana Store without your help!", width/2, height/6, width/2 - 20, height/4 * 3);
		introButton.show();
		if (introButton.isPressed) {
			titleScreen = false;
			game = true;
		}
	}
	
	//game
	if (game) {
		
		//black background
		imageMode (CORNER);
		image (backgroundImage, 0, 0, 800, 600);
		//background(0);

		//drop bananas
		if (frameCount % frequency == 0) {
			append (bananas, new Banana (monkey.x));
		}
		
		//call show & move monkey functions
		monkey.show();
		monkey.move();
		
		//execute Banana methods
		for (var i = 0; i < bananas.length; i++) {
			bananas[i].show();
			bananas[i].move();
			bananas[i].hitPaddle();
		}
		
		//increase banana drop frequency
		for (var i = bananas.length -1; i >= 0; i--) {
			if (bananas[i].unCaught == false) {
				bananas.splice (i, 1);
				score++;
				if (score % 5 == 0) {
					if (frequency >= 15) {
						frequency -= 2;
						bananaSpeedIncrease += .2;
					}
				}
			}
		}
		
		//delete bananas from object array
		for (var i = bananas.length -1; i >= 0; i--) {
			if (bananas[i].y > height) {
				bananas.splice (i, 1);
				lives--;
				if (lives == 0) {
					game = false;
					gameOver = true;
					if (!showButtons) {
						button.show();
						input.show();
						showButtons = true;
					}

				}
			}
		}
		basket.show();
		fill (255);
		textSize (20);
		textAlign (LEFT);
		text ("Score: " + score, 50, 50);
		textAlign (RIGHT)
		text ("Lives: " + lives, width -50, 50);
	}
	
	//game over screen
	if (gameOver) {
		background (0);
		textSize (25);
		textAlign (CENTER);
		text ("GAME OVER", width/2, height/2 - 50);
		text ("Score: " + score, width/2, height/2 - 25);
		text ("Enter your name to submit your score", width/2, height/2 + 25);
	}

	if (scoreboard) {
		background (0);
		fill (255);

		textAlign(CENTER);
		text ("High Scores", width/2, 25);

		textAlign (LEFT);
		text ("Name", 50, 60);

		textAlign (RIGHT);
		text ("Score", width - 50, 60);
		for (var i = 0; i < 15; i++) {
			textAlign (LEFT);
			text (scoreArray[i].name, 50, 100 + i * 25);
			textAlign (RIGHT);
			text (scoreArray[i].score, width - 50, 100 + i * 25);
		}

	}
}

var Basket = function () { 
	this.h = 40;
	this.w = 100;
	this.y = height - this.h;
	
	this.show = function () {
		imageMode (CENTER);
		image (basketImage, mouseX, this.y, this.w, this.h);
	}
	
}

var Banana = function (x) {
	this.x = x;
	this.d = 40;
	this.y = this.d/2;
	this.speed = 2;
	this.unCaught = true;
	
	this.show = function () {
		imageMode(CENTER);
		image (bananaImage, this.x , this.y, this.d, this.d);
	}
	
	this.move = function () {
		this.y += this.speed + bananaSpeedIncrease;
	}
	
	this.hitPaddle = function () {
		if (this.y > height - basket.h) {
			if (this.x > mouseX - basket.w/2) {
				if (this.x < mouseX + basket.w/2) {
					catchSound.play();
					this.unCaught = false;
				}
			}
		}
	}
}

var Monkey = function (x) {
	this.x = x;
	this.w = 80;
	this.h = 80;
	this.y = 0;
	this.monkeySpeed = 3;
	
	this.show = function () {
		image (monkeyImage, this.x, this.y, this.w, this.h);
	}
	
	this.move = function () {
		this.x += this.monkeySpeed;
		if (random() < .04) {
			this.monkeySpeed *= -1;
		}
		if (this.x > width - 40) {
			this.monkeySpeed = abs(this.monkeySpeed) * -1;
		}
		if (this.x < 40) {
			this.monkeySpeed = abs(this.monkeySpeed);
		}	
	}
}

function recordsScore () {
		var data = {
		  	name: input.value(),
		  	score: score,
		  	time: firebase.database.ServerValue.TIMESTAMP
	  	}
		ref.push(data);
		button.hide();
		input.hide();
		scoreboard = true;
}

var Button = function (x, y, w, h, buttonText) {
	this.x = x;
	this.y = y;
	this.w = w;
	this.h = h;
	this.x = this.x - this.w/2;
	this.buttonText = buttonText;
	this.isPressed = false;

	this.show = function () {
		rectMode (CORNER);	
		strokeWeight (2);
		stroke (255);
		fill (0);
		rect (this.x, this.y, this.w, this.h);
		fill (255);
		textSize (15);
		textAlign (CENTER, CENTER);
		text (this.buttonText, this.x + this.w/2, this.y + this.h/2);
		strokeWeight (1);
	}

	this.click = function () {
		if (mouseX > this.x && mouseX < this.x + this.w) {
			if (mouseY > this.y && mouseY < this.y + this.h) {
				this.isPressed = true;
			}
		}
	}
}

function gotData(data) {
  var scores = data.val();
  scoreArray = [];
  for (i in scores) {
  	scoreArray.push(scores[i]); 
  }
  scoreArray.sort(function (a,b) {
  	return b.score - a.score;
  })

}

function mouseClicked () {
	introButton.click ();
}